import React, {Component} from 'react';
import Aux from '../../hoc/Aux';
import Burger from '../../components/Burger/Burger';   

class BurguerBuilder extends Component{

    render(){
        return(
            <Aux>
                <Burger></Burger>
                <div>Build Controls</div>
            </Aux>
            
        );
    }
}

export default BurguerBuilder;
